import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class AboutMe extends Component {
    render() {
        return(
            <div className="contact-body">
            <Grid className="contact-grid">
                <Cell col={6}>
                    <h2>David Dirks</h2>

                </Cell>
                <Cell col={6}>half of page</Cell>
            </Grid>
            </div>
        )
    }
}

export default AboutMe;
